import React from 'react';
import '../../App.css';
import HeroSection from '../Herosection';
import About from './About';
import Contact from './Contact';
import Service from './Service';

function Home() {
  return (
    <>
      <HeroSection/>
      <Service/>
      <About/>
      <Contact/>
    </>
  );
}

export default Home;
